import{_ as e,c as d,o as r,ah as a}from"./chunks/framework.DGOuNAW6.js";const u=JSON.parse('{"title":"SECS GEM","description":"","frontmatter":{},"headers":[],"relativePath":"en_US/configuration/south-devices/secs-gem/secs-gem.md","filePath":"en_US/configuration/south-devices/secs-gem/secs-gem.md"}'),o={name:"en_US/configuration/south-devices/secs-gem/secs-gem.md"};function i(n,t,s,l,c,p){return r(),d("div",null,[...t[0]||(t[0]=[a('<h1 id="secs-gem" tabindex="-1">SECS GEM <a class="header-anchor" href="#secs-gem" aria-label="Permalink to “SECS GEM”">​</a></h1><p>The SECS GEM HSMS driver supports accessing devices that comply with the SEMI E37 HSMS standard through the TCP/IP protocol. Currently, it supports passive mode for devices and acts as the active host connection.</p><h2 id="parameter-configuration" tabindex="-1">Parameter Configuration <a class="header-anchor" href="#parameter-configuration" aria-label="Permalink to “Parameter Configuration”">​</a></h2><table tabindex="0"><thead><tr><th>Parameter</th><th>Description</th></tr></thead><tbody><tr><td>host</td><td>Target Device IP address</td></tr><tr><td>port</td><td>Target Device port, default 5000</td></tr><tr><td>deviceid</td><td>Target Device ID, default 0</td></tr></tbody></table><h2 id="support-data-type" tabindex="-1">Support Data Type <a class="header-anchor" href="#support-data-type" aria-label="Permalink to “Support Data Type”">​</a></h2><ul><li>uint8</li><li>int8</li><li>uint16</li><li>int16</li><li>uint32</li><li>int32</li><li>uint64</li><li>int64</li><li>float</li><li>double</li><li>bool</li><li>string</li><li>bytes</li></ul><h2 id="address" tabindex="-1">ADDRESS <a class="header-anchor" href="#address" aria-label="Permalink to “ADDRESS”">​</a></h2><blockquote><p>SxFy([_1][_2][_3][_4])</p></blockquote><h2 id="streams-and-functions" tabindex="-1">Streams and Functions <a class="header-anchor" href="#streams-and-functions" aria-label="Permalink to “Streams and Functions”">​</a></h2><p>SECS-II messages are referred to as Streams and Functions. Each message has a Stream value (Sx) and a Function value (Fy). In the case of a Stream 1 Function 1, it is written as S1F1, and spoken as “S1F1”. Streams are categories of messages while Functions are specific messages within the category. The function value is always an odd number in a primary message, and one greater, or even, in the associated secondary reply.</p><table tabindex="0"><thead><tr><th>Stream</th><th>Description</th></tr></thead><tbody><tr><td>1</td><td>Equipment Status</td></tr><tr><td>2</td><td>Equipment Control</td></tr><tr><td>3</td><td>Material Status</td></tr><tr><td>4</td><td>Material Control</td></tr><tr><td>5</td><td>Alarm Handling</td></tr><tr><td>6</td><td>Data Collection</td></tr><tr><td>7</td><td>Recipe Management</td></tr><tr><td>8</td><td>Control Program Transfer</td></tr><tr><td>9</td><td>System Errors</td></tr><tr><td>10</td><td>Terminal Services</td></tr><tr><td>11</td><td>(Not Used)</td></tr><tr><td>12</td><td>Wafer Mapping</td></tr><tr><td>13</td><td>Unformatted Data Set Transfers</td></tr></tbody></table><p><strong>Some SxFy</strong></p><table tabindex="0"><thead><tr><th>Stream Function</th><th>Description</th></tr></thead><tbody><tr><td>S1F1</td><td>Are You There Request (R)</td></tr><tr><td>S1F2</td><td>On Line Data (D)</td></tr><tr><td>S1F3</td><td>Selected Equipment Status Request (SSR)</td></tr><tr><td>S1F4</td><td>Selected Equipment Status Data (SSD)</td></tr><tr><td>S6F7</td><td>Data Transfer Request (DDR)</td></tr><tr><td>S6F8</td><td>Data Transfer Data (DDD)</td></tr><tr><td>S6F15</td><td>Event Report Request (ERR)</td></tr><tr><td>S6F16</td><td>Event Report Data (ERD)</td></tr></tbody></table><h2 id="special-type-processing" tabindex="-1">Special Type Processing <a class="header-anchor" href="#special-type-processing" aria-label="Permalink to “Special Type Processing”">​</a></h2><p>The SECS-II message definition defines the LIST type, which is also supported by the plugin through the string type. However, there is a deserialization process involved, with specific rules as follows.</p><table tabindex="0"><thead><tr><th>SECS-II Type</th><th>deserialization</th><th>Description</th></tr></thead><tbody><tr><td>LIST</td><td><code>&lt;L[n] xxx&gt;(.)</code></td><td>n is the length of the LIST, and when the LIST is empty set n to 0. The outermost LIST includes . at the end</td></tr><tr><td>ASCII</td><td><code>&lt;A[n] xxx&gt;</code></td><td>n is the length of the ASCII, and when the ASCII is empty set n to 0.</td></tr><tr><td>Binary</td><td><code>&lt;B[n] xxx&gt;</code></td><td>n is the length of the Binary, and when the Binary is empty set n to 0.</td></tr><tr><td>Boolean</td><td><code>&lt;Boolean x&gt;</code></td><td></td></tr><tr><td>UINT8</td><td><code>&lt;U1 x&gt;</code></td><td></td></tr><tr><td>UINT16</td><td><code>&lt;U2 x&gt;</code></td><td></td></tr><tr><td>UINT32</td><td><code>&lt;U4 x&gt;</code></td><td></td></tr><tr><td>UINT64</td><td><code>&lt;U8 x&gt;</code></td><td></td></tr><tr><td>INT8</td><td><code>&lt;I1 x&gt;</code></td><td></td></tr><tr><td>INT16</td><td><code>&lt;I2 x&gt;</code></td><td></td></tr><tr><td>INT32</td><td><code>&lt;I4 x&gt;</code></td><td></td></tr><tr><td>INT64</td><td><code>&lt;I8 x&gt;</code></td><td></td></tr><tr><td>32FLOAT</td><td><code>&lt;F4 x&gt;</code></td><td></td></tr><tr><td>64FLOAT</td><td><code>&lt;F8 x&gt;</code></td><td></td></tr></tbody></table><p>The LIST type supports accessing specific elements using indices, and currently supports nesting of up to four layers of LISTs.</p><h2 id="q-a" tabindex="-1">Q&amp;A <a class="header-anchor" href="#q-a" aria-label="Permalink to “Q&amp;A”">​</a></h2><ul><li><p>How to fill in the Device ID? The Device ID can usually be viewed on the SECS GEM HSMS protocol configuration page of the device.</p></li><li><p>How to serialize ASCII type in LIST? This plugin serializes ASCII in LIST as <code>&lt;A[n] xxx&gt;</code>, without quotes for the content. For example, &quot;ABC&quot; is serialized as <code>&lt;A[3] ABC&gt;</code>, not <code>&lt;A[3] &quot;ABC&quot;&gt;</code>.</p></li><li><p>How to serialize Binary type in LIST? This plugin serializes Binary in LIST as <code>&lt;B[n] xx&gt;</code>, without quotes for the content. For example, 0xFF is serialized as <code>&lt;B[1] FF&gt;</code>, not <code>&lt;B[2] &quot;FF&quot;&gt;</code>.</p></li><li><p>What type should be selected when creating a new point for data of LIST type? For points with device data type <strong>LIST</strong>, select <strong>string</strong> type when creating a new point.</p></li><li><p>How to create a new point for events actively reported by the device, such as &quot;S6F11&quot;? For points actively reported by the device, such as &quot;S6F11&quot;, simply create the corresponding point.</p></li><li><p>How to create a new point for obtaining data that requires passing parameters? For example, &quot;S1F3&quot; requires passing a <strong>LIST</strong> type parameter, and its return value will be returned through &quot;S1F4&quot;, which also has <strong>LIST</strong> type. For this point, we need to create two points, with one having address &quot;S1F3&quot; and property configuration <strong>Write</strong>, and type <strong>string</strong>. The other has address &quot;S1F4&quot; and property configuration <strong>Read</strong> or <strong>Sub</strong>, and type <strong>string</strong>. Use the first point to write the parameter, and the second point to obtain the return value.</p></li><li><p>How to create a new point for obtaining data without passing parameters? For example, &quot;S1F1&quot; does not require passing parameters. Simply create one point, and its return value will be displayed directly on this point.</p></li></ul>',19)])])}const g=e(o,[["render",i]]);export{u as __pageData,g as default};
